summary:
Beleidsadviseur Ruimtelijke Ontwikkeling vanuit een moderne, participerende overheid met oog en passie voor de transitie die we doormaken. 

Zeer ervaren architect, stedebouwer en imagineer. Vernieuwer van de woningmarkt, strategisch denker, ontwerpt processen voor het ruimtelijk domein. 

Ervaring als politicus en met het ontwikkelen van beleid. Kandidaat nr.17 voor Volt in Nederland voor de Tweede Kamerverkiezingen 2021. Coördinator van het beleidsprogramma voor Volt TK2021. Gemeenteraadslid voor D66 in Breda van 2012 tot 2018. 

Teamplayer, met oog voor de kwaliteiten van het team en haar leden. Omdenker, gepassioneerd over de kansen van de 21e eeuw. Netwerker op vele niveaus.

Specialismen: 
- ruimtelijke ontwikkeling;
- transitie naar natuurinclusieve landbouw;
- herbestemming van erfgoed;
- leisure, hotels, wellness;
- inzicht in lokale politiek;
- procesbegeleiding en participatie;
- collectieve woonvormen (CPO, flexwonen etc.).
